INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (1, 1, 'Giày Falcon', 'Đôi giày adidas Falcon này mang cảm hứng thập niên 90, hồi tưởng lại thời kỳ lên ngôi của áo crop top và quần ống rộng.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (2, 1, 'ULTRABOOST 20', 'ULTRABOOST luôn là dòng giày thể thao được ưa chuộng nhất vì sự êm ái vượt trội cùng nhiều phối màu hấp dẫn.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (3, 1, 'Giày ADIDAS SLEEK SUPER', 'Mềm mại, mượt mà và cũng chính là chất liệu làm nên đôi giày adidas Sleek Super này. Đế ngoài kiểu platform còn cho bạn thêm chút lợi thế chiều cao.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (4, 1, 'STAN SMITH', 'Basic là phong cách của bạn? Stand Smith sẽ là sự lựa chọn tuyệt vời đấy!', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (5, 1, 'NMD_R1', 'Tôn vinh phong cách đường phố cấp tiến. Dòng sản phẩm NMD kết hợp giữa phong cách đua xe hoài cổ với kiểu dáng tinh giản.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (6, 2, 'Air Jordan 1 Low', 'Đôi giày được tạo ra phù hợp với mọi phong cách, thiết kế mang tính biểu tượng và không bao giờ lỗi mốt.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (7, 2, 'Nike Air Max 97', 'Nike Air Max 97 được nâng tầm thiết kế cổ điển với lớp ngoài màu Vàng ánh kim. ', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (8, 2, 'Nike Air Force 1', 'Một đôi giày trắng là phụ kiện hoàn hảo không thế thiếu trong tủ đồ của các tín đồ thời trang.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (9, 3, 'Gucci sneaker with mouth print', 'Đôi giày lấy cảm hứng từ những ban nhạc rock. Được thiết kế với đế dày và mang phong cách chunky.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (10, 4, 'Puma Cali Sport Pastel', 'Phiên bản màu Pastel mơ mộng này là phiên bản cải tiến mới nhất của PUMA, với phần đế giữa cao hơn, xếp chồng lên nhau và màu sắc tươi mới.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');
INSERT INTO duongshoe.product (id, catalog_id, product_name, description, status, create_date, update_date) VALUES (11, 5, 'Biti''s Hunter', 'Dòng giày thể thao cao cấp mới nhất đến từ thương hiệu Biti''s.', 1, '2020-05-16 13:50:30', '2020-05-19 14:35:52');